    eventLogger = (e: MouseEvent, data: Object) => {
        console.log('Event: ', e);
        console.log('Data', data);
    }

    handleStop = (data) => {
      if (data.x > 100 && data.y > 500) {
        console.log(data.x);
        console.log(data.y);
      }
          console.log("hi");

    }


  render() {
    return (
        <Draggable
        axis = "both"
        handle = ".item"
        defaultPosition={{x: 0, y: 0}}
        position={null}
        scale={1}
        onStart={this.handleStart}
        onDrag={this.handleDrag}
        onStop={this.handleStop}>
        <div className = "item">
            <img id="layout" draggable="false" src={food} />
        </div> 
        </Draggable>
    );
  }
}

export default Item;
